import React from "react";

const BookFavorite = (props) =>{


    return(
        props.booksfav.map((props) => {
        <div className="listbook" key={props.id}>
        <div className="imagenya">
          <img className="imgstyle" src={props.image} alt={props.name} />
        </div>
        <div className="descnya">
          <h3>Judul : {props.name}</h3>
          <p>
            <br />
            <span>Author: {props.author}</span>
            <button onClick={() => props.delete(props.id)}>
              Delete from Favorite
            </button>
          </p>
        </div>
        </div>
        })
        
    )
}

export default BookFavorite
